function App() {

  var btn = document.createElement('div');   // Create a <button> element
  btn.innerHTML = "CLICK ME";                   // Insert text
  document.getElementById('root').appendChild(btn);   

  return ReactDOM.render(
    btn,
    document.getElementById('root')
  );
}


export default App;
